    [],nt"num_tags": 2,nt"name": "narrative-report-big-stone-national-wildlife-refuge-calendar-year-1972",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Big Stone
    NWR outlines Refuge accomplishments during the 1972 calendar year. The report begins
    by summarizing the weather conditions, habitat conditions, water conditions, and
    food and cover conditions during the year. Wildlife- including migratory birds,
    upland game birds, big game animals, mammals, and raptors- is also covered. The
    Refuge development and maintenance section discusses physical developments, plantings,
    collections and receipts, and vegetation control. Resource management is outlined;
    topics include grazing, haying, and fur harvesting. The public relations section
    of the report describes recreational uses, Refuge visitors, Refuge participation,
    hunting, and violations. Items of interest and photographs are attached.",nt"owner_org":
